pragma solidity ^0.5.2;

import "./Ownable.sol";
import "./Tartarus.sol";

contract User is Ownable {
    address public creator;
    bytes32 public username;
    uint public time;

    function initialize(address _owner, address _creator, bytes32 _username) external {
        require(owner == address(0), "Nice try");
        owner = _owner;
        creator = _creator;
        username = _username;
        time = now;
    }

    function createForum(bytes32 _forumName) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).createForum(_forumName);
    }   

    function deleteForum(bytes32 _forumName, address payable _suicideAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).deleteForum(_forumName, _suicideAddress);
    }  

    function createPost(bytes32 _forumName, bytes32 _post) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).createPost(_forumName, _post);
    }

    function deletePost(bytes32 _forumName, address _postAddress, address payable _suicideAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).deletePost(_forumName, _postAddress, _suicideAddress);
    }

    function createComment(bytes32 _forumName, address _postAddress, address _targetAddress, bytes32 _comment) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).createComment(_forumName, _postAddress, _targetAddress, _comment);
    }

    function deleteComment(bytes32 _forumName, address _postAddress, address _commentAddress, address payable _suicideAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).deleteComment(_forumName, _postAddress, _commentAddress, _suicideAddress);
    }

    function upvote(bytes32 _forumName, address _postAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).upvote(_forumName, _postAddress);
    }

    function downvote(bytes32 _forumName, address _postAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).downvote(_forumName, _postAddress);
    }

    function pinPost(bytes32 _forumName, address _postAddress) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).pinPost(_forumName, _postAddress);
    }

    function unpinPost(bytes32 _forumName, address _postAddress, uint _postIndex) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).unpinPost(_forumName, _postAddress, _postIndex);
    }

    function reportUser(bytes32 _username, bytes32 _reason) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).reportUser(_username, _reason);
    }

    function reportForum(bytes32 _forumName, bytes32 _reason) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).reportForum(_forumName, _reason);
    }

    function reportPost(bytes32 _forumName, address _postAddress, bytes32 _reason) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).reportPost(_forumName, _postAddress, _reason);
    }

    function reportComment(bytes32 _forumName, address _commentAddress, bytes32 _reason) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).reportComment(_forumName, _commentAddress, _reason);
    }

    function createModerator(
        bytes32 _forumName,
        bytes32 _username, 
        bool _ban, 
        bool _editRules, 
        bool _editDescription, 
        bool _editModerators, 
        bool _deletePost, 
        bool _deleteComment) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).createModerator(
        _forumName,
        _username,
        _ban, 
        _editRules,
        _editDescription,
        _editModerators,
        _deletePost,
        _deleteComment);
    }

    function removeModerator(bytes32 _forumName, bytes32 _username) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).removeModerator(_forumName, _username);
    }

    function updateForumRules(bytes32 _forumName, bytes32 _rules) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).updateForumRules(_forumName, _rules);
    }

    function updateForumDescription(bytes32 _forumName, bytes32 _description) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).updateForumDescription(_forumName, _description);
    }

    function banUserForum(bytes32 _forumName, bytes32 _userName) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).banUserForum(_forumName, _userName);
    }

    function unbanUserForum(bytes32 _forumName, bytes32 _userName) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).unbanUserForum(_forumName, _userName);
    }

    function createAdmin(
        bytes32 _username, 
        bool _ban,
        bool _transactionCost,
        bool _createUserCost,
        bool _editAdmin,
        bool _deletePost,
        bool _deleteComment,
        bool _deleteForum
    ) public {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).createAdmin(
        _username, 
        _ban,
        _transactionCost,
        _createUserCost,
        _editAdmin,
        _deletePost,
        _deleteComment,
        _deleteForum);
    }  

    function removeAdmin(bytes32 _username) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).removeAdmin(_username);
    }

    function banUserTartarus(bytes32 _username) external view {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).banUserTartarus(_username);
    }

    function unbanUserTartarus(bytes32 _username) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).unbanUserTartarus(_username);
    }

    function setCreateUserCost(uint _newCost) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).setCreateUserCost(_newCost);
    }

    function setTransactionCost(uint _newCost) external {
        require(msg.sender == creator, "Not user contract creator");
        Tartarus(owner).setTransactionCost(_newCost);
    }
}
